"use strict";(self.webpackChunktwo=self.webpackChunktwo||[]).push([[165],{4562:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"/3_6_7","metadata":{"permalink":"/fil/3_6_7","source":"@site/i18n/fil/docusaurus-plugin-content-blog/3_6_7/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.7 Update Notes","description":"I-unlock ang kalidad ng video","date":"2022-04-27T00:00:00.000Z","formattedDate":"Abril 27, 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-27T00:00:00.000Z"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.6.6 Update Notes","permalink":"/fil/3_6_6"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityUnlock from \'./qualityUnlock.png\';\\n\\n\\n\\n\\n### I-unlock ang kalidad ng video\\n\\nNgayon ang default na lock ng kalidad ng video ay inilabas, at maaari kang lumipat ng mga estado sa pamamagitan ng pag-click, at kailangan mong i-refresh ang pahina pagkatapos lumipat ng mga estado.\\n\\n<img src={qualityUnlock} alt=\\"qualityUnlock.png\\" width=\\"330\\" height=\\"320\\" />\\n\\n<WebStore />"},{"id":"/3_6_6","metadata":{"permalink":"/fil/3_6_6","source":"@site/i18n/fil/docusaurus-plugin-content-blog/3_6_6/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.6 Update Notes","description":"### Ayusin ang lock ng kalidad ng video","date":"2022-04-11T00:00:00.000Z","formattedDate":"Abril 11, 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-11T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.7 Update Notes","permalink":"/fil/3_6_7"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.6.5 Update Notes","permalink":"/fil/3_6_5"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityLock from \'./qualityLock.png\';\\nimport defaultStyle from \'./defaultStyle.png\';\\n\\n\\n\\n\\n ### Ayusin ang lock ng kalidad ng video\\n\\n Ibinigay ang function ng lock ng kalidad ng video sa bersyon 3.6.3, ngunit kapag pinili ang Auto, naka-lock pa rin ang kalidad at hindi maaaring dynamic na isaayos. Naayos na ang problemang ito.\\n\\n<img src={qualityLock} alt=\\"qualityLock.png\\" width=\\"276\\" height=\\"389\\" />\\n\\n### Ibalik ang default na istilo ng subtitle\\n\\nAng mga preset na istilo ng subtitle ay ibinigay sa mga nakaraang bersyon, at ang default na istilo ng subtitle ay naaayon na ngayon sa YouTube.\\n\\nKung kailangan mong bumalik sa default na istilo, maaari mong i-click ang button na I-reset ang Estilo.\\n\\n<img src={defaultStyle} alt=\\"defaultStyle.png\\" width=\\"340\\" height=\\"524\\" />\\n\\n<WebStore />"},{"id":"/3_6_5","metadata":{"permalink":"/fil/3_6_5","source":"@site/i18n/fil/docusaurus-plugin-content-blog/3_6_5/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.5 Update Notes","description":"### Ayusin ang mga subtitle na hindi bumabalot","date":"2022-04-07T00:00:00.000Z","formattedDate":"Abril 7, 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-07T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.6 Update Notes","permalink":"/fil/3_6_6"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.6.0 Update Notes","permalink":"/fil/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport improveHandle from \'./improveHandle.gif\';\\nimport subtitleRightClickMenu from \'./subtitleRightClickMenu.gif\';\\nimport subtitleTips from \'./subtitleTips.png\';\\nimport subtitleWrap from \'./subtitleWrap.png\';\\n\\n\\n\\n\\n ### Ayusin ang mga subtitle na hindi bumabalot\\n\\n Inayos ang isang isyu na naging sanhi ng pag-apaw ng mga subtitle nang hindi binabalot kapag ang font ay masyadong malaki sa nakaraang bersyon.\\n\\n<img src={subtitleWrap} alt=\\"subtitleWrap.png\\" width=\\"600\\" height=\\"698\\" />\\n\\n### Ayusin ang subtitle prompt\\n\\nSa mga nakaraang bersyon, gagamitin din ng subtitle prompt ang istilo, at ngayon ay maiiwasan ang problemang ito.\\n\\n<img src={subtitleTips} alt=\\"subtitleTips.png\\" width=\\"600\\" height=\\"682\\" />\\n\\n### Pagbutihin ang hawakan\\n\\nAng mga pindutan ng hawakan ay dating mahirap i-drag kapag ang subtitle ay na-drag sa hangganan, ngayon ay mas madaling gamitin sa pamamagitan ng pagbabago ng posisyon ng hawakan.\\n\\n<img src={improveHandle} alt=\\"improveHandle.gif\\" width=\\"600\\" height=\\"338\\" />\\n\\n### Subtitle na right-click na menu\\n\\nNoong nakaraan, maaaring kopyahin ang mga subtitle, ngunit hindi maisagawa ang right-click na operasyon. Ngayon ay napabuti na ang problemang ito.\\n\\n<img src={subtitleRightClickMenu} alt=\\"subtitleRightClickMenu.gif\\" width=\\"600\\" height=\\"313\\" />\\n\\n<WebStore />"},{"id":"/3_6_0","metadata":{"permalink":"/fil/3_6_0","source":"@site/i18n/fil/docusaurus-plugin-content-blog/3_6_0/index.mdx","title":"YouTube\u2122 Dual Caption 3.6.0 Update Notes","description":"Ayusin ang pagsasama ng pahayag \ud83c\udf89","date":"2021-12-16T00:00:00.000Z","formattedDate":"Disyembre 16, 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-12-16T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.5 Update Notes","permalink":"/fil/3_6_5"},"nextItem":{"title":"YouTube\u2122 Dual Caption 3.5.0 Update Notes","permalink":"/fil/3_5_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport mark from \'./mark.png\';\\nimport disableStyle from \'./disableStyle.gif\';\\nimport order from \'./order.gif\';\\n\\n\\n### Ayusin ang pagsasama ng pahayag \ud83c\udf89\\n\\n Sa nakaraang bersyon, hindi ginawa ang pagsasanib ng pahayag upang masundan ang sariling gawi ng YouTube.\\n\\nNaging sanhi ito ng pabagu-bago ng mga pangungusap kapag nagpe-play ng video, at ang pag-download ng mga subtitle ay naging sanhi din ng pagkagulo ng timeline.\\n\\nSa bersyon 3.6.0, ang problemang ito ay naayos at higit pang mga detalye ang na-optimize.\\n\\nInalis ang mga dagdag na puwang sa mga merge statement.\\n\\n```\\n 1\\n 00:00:03,678 --\x3e 00:00:05,960\\n means that many aspects  of our lives\\n \u610f\u5473\u7740 \u6211\u4eec\u751f\u6d3b\u7684\u8bb8\u591a\u65b9\u9762\\n\\n 2\\n 00:00:05,960 --\x3e 00:00:08,214are regulated  by a weird entity.\\n \u90fd \u53d7\u5230\u4e00\u4e2a\u5947\u602a\u7684\u5b9e\u4f53\u7684\u76d1\u7ba1\u3002\\n\\n 3\\n 00:00:09,050 --\x3e 00:00:13,453It feels like a huge bureaucracy is making decisions over our heads.\\n \u611f\u89c9\u5c31\u50cf\u4e00\u4e2a\u5de8\u5927\u7684\u5b98\u50da\u673a\u6784 \u6b63\u5728\u6211\u4eec\u7684\u5934\u8111\u4e2d\u505a\u51fa\u51b3\u5b9a\u3002\\n ```\\n\\nInalis ang blangkong timeline para sa pag-download ng mga subtitle.\\n\\n```\\n 1\\n 00:00:00,000 --\x3e 00:00:00,500\\n\\n\\n\\n 2\\n 00:00:00,500 --\x3e 00:00:03,090\\n PETE LEPAGE: You can now upload extensions using Manifest\\n PETE LEPAGE: \u60a8\u73b0\u5728\u53ef\u4ee5 \u4f7f\u7528 Manifest V3 \u5c06\u6269\u5c55\u7a0b\u5e8f\u4e0a\u4f20\\n\\n 3\\n 00:00:03,090 --\x3e 00:00:05,100\\n V3 to the Chrome Web Store.\\n \u5230 Chrome \u7f51\u4e0a\u5e94\u7528\u5e97\u3002\\n ```\\n\\n### Binibigyan ng priyoridad ng dalawahang subtitle ang mga subtitle ng video\\n\\n Dati, palaging machine-translated ang mga bilingual na subtitle. Ngayon, gagamitin muna ang mga kasalukuyang subtitle ng video, at gagamitin ang machine translation kung walang subtitle.\\n\\n Kung ang bilingual na video ay mayroon nang mga subtitle, isang optimization indicator ang ipapakita.\\n\\n Ang pag-download ng mga subtitle ay magkakaroon din ng parehong pag-optimize, na may tik sa gitna ng filename.\\n\\n<Tip>Isinasaad ng logo na ginagamit ng kasalukuyang mga bilingual na subtitle ang mga kasalukuyang subtitle ng video, hindi ang machine translation.</Tip>\\n\\n<img src={mark} alt=\\"mark.png\\" width=\\"891\\" height=\\"262\\" />\\n\\n### I-off ang mga custom na istilo\\n\\n Ang bersyon na ito ay nagbibigay ng opsyon upang i-off ang custom na istilo, at maaaring itakda ang pagkakasunud-sunod ng subtitle at spacing nang hiwalay.\\n\\n<Tip>Tip: Ang saligan ng pag-optimize na ito ay dapat na eksaktong magkatugma ang dalawang subtitle.</Tip>\\n\\n<img src={disableStyle} alt=\\"disableStyle.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n### Mag-download ng mga subtitle sa parehong pagkakasunud-sunod kung paano ipinapakita ang mga ito\\n\\n<img src={order} alt=\\"order.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n<WebStore />"},{"id":"/3_5_0","metadata":{"permalink":"/fil/3_5_0","source":"@site/i18n/fil/docusaurus-plugin-content-blog/3_5_0/index.mdx","title":"YouTube\u2122 Dual Caption 3.5.0 Update Notes","description":"Custom na istilo ng font","date":"2021-08-24T00:00:00.000Z","formattedDate":"Agosto 24, 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-08-24T00:00:00.000Z"},"prevItem":{"title":"YouTube\u2122 Dual Caption 3.6.0 Update Notes","permalink":"/fil/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport light from \'./light.png\';\\nimport dark from \'./dark.png\';\\nimport tip from \'./tip.gif\';\\nimport singlebutton from \'./singlebutton.png\';\\nimport single from \'./single.png\';\\nimport translationError from \'./translationError.gif\';\\n\\n\\n### Custom na istilo ng font\\n\\nI-click ang icon ng extension upang i-pop up ang page ng mga setting upang suportahan ang dark mode.\\n\\nMga custom na opsyon: font, laki ng font, kulay, kulay ng background, spacing, at pagkakasunud-sunod ng subtitle.\\n\\n<img src={light} alt=\\"light.png\\" width=\\"340\\" height=\\"472\\" />\\n<img src={dark} alt=\\"dark.png\\" width=\\"340\\" height=\\"472\\" />\\n\\n<Tip>Ang pag-hover sa icon ay magpapakita kung ano ang kinakatawan ng setting.</Tip>\\n\\n<img src={tip} alt=\\"tip.gif\\" width=\\"340\\" height=\\"472\\" />\\n\\n### Isang istilo ng subtitle\\n\\nPagkatapos lumipat sa single subtitle mode, ang solong subtitle style ay maaaring itakda nang hiwalay.\\n\\n<img src={singlebutton} alt=\\"singlebutton.png\\" width=\\"314\\" height=\\"372\\" />\\n<img src={single} alt=\\"single.png\\" width=\\"340\\" height=\\"406\\" />\\n\\n### Iba pang mga pag-optimize\\n\\nAlisin ang Chinese Traditional to Simplified program library, bawasan ang laki ng program at pahusayin ang performance, dahil opisyal na inayos ng YouTube ang bug na ito.\\n\\n<Tip>Minsan nawawala ang mga subtitle, karamihan ay dahil sa mga error sa pagsasalin ng YouTube.</Tip>\\n\\n<img src={translationError} alt=\\"translationError.gif\\" width=\\"700\\" height=\\"396\\" />\\n\\nSa hinaharap, ang iba pang mga makina ng pagsasalin ay ipakikilala upang malutas ang problemang ito at mapunan ang hindi tumpak na pagsasalin.\\n\\n<WebStore />"}]}')}}]);